import React from "react";
import { Wrapper, Heading, Content } from "./Header.styles";

export const Header = () => {
    return (
        <Wrapper>
            <Heading>
                Tenzies
            </Heading>
            <Content>
            Roll until all dice are the same. Click each die to freeze it at its current value between rolls.
            </Content>
        </Wrapper>
    )
}
